import React from 'react';
import { Link } from 'react-router-dom';

const FloatingActionButton = () => {
  return (
    <div className="fixed bottom-8 right-8">
      <Link
        to="/query-form"
        className="bg-blue-600 text-white px-6 py-3 rounded-full shadow-lg hover:bg-blue-700 transition duration-300 flex items-center justify-center space-x-2"
      >
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="h-5 w-5"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M12 4v16m8-8H4"
          />
        </svg>
        <span>Ask a Query</span>
      </Link>
    </div>
  );
};

export default FloatingActionButton;
